webpackJsonp([19,429],{1382:function(e,i,t){e.exports={frontmatter:t(383),content:t(2566)}},2566:function(e,i,t){e.exports="<section class=intro id=introduksjon> <h1 class=intro id=introduksjon>Introduksjon</h1> <p>I denne veiledningen skal du lage en konto på Learn To Mod (LTM) og koble den til din Minecraft-konto.</p> </section> <section class=activity id=lage-en-ltm-konto> <h1 class=activity id=lage-en-ltm-konto>Lage en LTM-konto</h1> <section class=check id=sjekkliste> <h2 class=check id=sjekkliste>Sjekkliste</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_0><label for=cbx_0> Åpne nettleseren din (Chrome, Internett Explorer, Firefox eller Safari).</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_1><label for=cbx_1> Gå til adressen <em><a href=http://www.learntomod.com>learntomod.com</a></em>.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_2><label for=cbx_2> Du skal komme til en side som ser sånn ut:</label></p> <figure><img src="+t(3323)+' alt=""></figure> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_3><label for=cbx_3> Trykk på knappen øverst til høyre som heter <strong>Login</strong>, ikke klikk på <strong>Sign Up</strong> enda.</label></p> <figure><img src='+t(3324)+' alt=""></figure> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_4><label for=cbx_4> Trykk på <strong>Create an account!</strong> for å registrere en konto.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_5><label for=cbx_5> Fyll inn epost og passord.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_6><label for=cbx_6> Klikk på <strong>Submit</strong>.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_7><label for=cbx_7> Det er smart å velge et passord som du husker. Lagre gjerne passordet om du får beskjed om det.</label></p> </li> </ul> </section> </section> <section class=activity id=logge-inn-pa-ltm> <h1 class=activity id=logge-inn-pa-ltm>Logge inn på LTM</h1> <section class=check id=sjekkliste-2> <h2 class=check id=sjekkliste-2>Sjekkliste</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_8><label for=cbx_8> Logg deg inn ved å fylle ut epost og passord:</label></p> <figure><img src='+t(3325)+' alt=""></figure> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_9><label for=cbx_9> Første gang du er med på kurs må du angi en klassekode.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_10><label for=cbx_10> Klassekoden får du av den som holder kurset.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_11><label for=cbx_11> Fyll klassekoden i det feltet som heter <strong>Class Key</strong>.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_12><label for=cbx_12> Du får spørsmål om hva som skal være ditt <strong>Nickname</strong>.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_13><label for=cbx_13> Du kan bruke det navnet du vil, for eksempel det samme som du kaller deg i minecraft, men ikke start navnet med tall.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_14><label for=cbx_14> Fyll ut navnet og trykk på knappen.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_15><label for=cbx_15> Du skal nå få opp hjemmesiden:</label></p> <figure><img src='+t(3326)+' alt=""></figure> </li> </ul> </section> </section> <section class=activity id=koble-til-minecraft-kontoen-din> <h1 class=activity id=koble-til-minecraft-kontoen-din>Koble til Minecraft-kontoen din</h1> <p>Hvis det er første gang du er med på kurset vil du se et grønt felt som sier <strong>Server status: Offline</strong>. Altså må du koble til Minecraft kontoen din.</p> <section class=check id=sjekkliste-3> <h2 class=check id=sjekkliste-3>Sjekkliste</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_16><label for=cbx_16> Klikk på det grønne feltet hvor det står <strong>Server status: Offline</strong>.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_17><label for=cbx_17> Du kommer til en side som dette:</label></p> <figure><img src='+t(3327)+' alt=""></figure> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_18><label for=cbx_18> Gå nedover på siden til du kommer til <strong>Step 3</strong>:</label></p> <figure><img src='+t(3328)+' alt=""></figure> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_19><label for=cbx_19> Skriv brukernavnet ditt i Minecraft inn i feltet.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_20><label for=cbx_20> Trykk på knappen <strong>Connect</strong>.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_21><label for=cbx_21> Det vil komme opp et vindu som sier at du har fått en badge.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_22><label for=cbx_22> Knappen som heter <strong>Back to badges</strong> fungerer ikke enda, så du må må lukke vinduet.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_23><label for=cbx_23> Trykk på bakoverknappen i nettleseren for å komme til hjemmesiden.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_24><label for=cbx_24> Oppfrisk siden eller trykk på <strong>Home</strong> øverst til venstre for å friske opp siden.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_25><label for=cbx_25> Hjemmesiden skal nå vise <strong>Server status: Online</strong> i det grønne feltet til venstre:</label></p> <figure><img src='+t(3329)+' alt=""></figure> </li> </ul> </section> </section> <section class=activity id=logge-pa-ltms-server-i-minecraft> <h1 class=activity id=logge-pa-ltms-server-i-minecraft>Logge på LTMs server i Minecraft</h1> <p>Til slutt må du logge på Learn To Mod sin Minecraft-server, slik at du kan kjøre moddene dine i Minecraft.</p> <section class=check id=sjekkliste-4> <h2 class=check id=sjekkliste-4>Sjekkliste</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_26><label for=cbx_26> Åpne Minecraft.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_27><label for=cbx_27> Trykk på knappen <strong>Play</strong>.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_28><label for=cbx_28> Velg <strong>Multiplayer</strong>.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_29><label for=cbx_29> Velg <strong>Add Server</strong>.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_30><label for=cbx_30> Fyll inn navnet <code>Learntomod</code> og adresse <code>play.learntomod.com</code>:</label></p> <figure><img src='+t(3330)+' alt=""></figure> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_31><label for=cbx_31> Trykk på knappen <strong>Done</strong>.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_32><label for=cbx_32> Serveren blir nå lagt til i serverlisten din.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_33><label for=cbx_33> Koble deg til ved å dobbeltklikke på serveren i listen.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_34><label for=cbx_34> Når du er tilkoblet skal du komme til din egen verden. Det vil stå <strong>Loading your private server</strong> i noen sekunder før verdenen din starter i <strong>creative mode</strong>.</label></p> </li> </ul> </section> </section> <section class=activity id=ved-neste-kurs> <h1 class=activity id=ved-neste-kurs>Ved neste kurs</h1> <p>Når du kommer på kurset neste gang trenger du ikke gjøre alt på nytt. Da holder det å logge inn på siden <a href=http://www.learntomod.com>learntomod.com</a> og logge på serveren til Learn To Mod i Minecraft.</p> <p>Nå er du klar til å begynne å kode!</p> <section class=protip id=tips-hvis-du-far-trobbel> <h3 class=protip id=tips-hvis-du-far-trobbel>Tips hvis du får trøbbel</h3> <p>Hvis du ikke kommer til din egen server i Minecraft så er de vanligste grunnene:</p> <ol> <li> <p>Du prøver å koble deg til serveren når klassen din ikke er aktivert. Det vanligste er at klassen bare er aktivert når dere har undervisning. Hvis du har undervisning kan du spørre læreren om serveren er åpnet.</p> </li> <li> <p>Minecraft kontoen din ikke er koblet riktig opp mot Learntomod. Gå til <a href=http://www.learntomod.com>learntomod.com</a> og følg anvisningene i <a href=#koble-til-minecraft-kontoen-din>Koble til Minecraft-kontoen din</a>. Du må huske å skrive Minecraft-brukernavnet nøyaktig slik det er i Minecraft, husk at det er forskjell på store og små bokstaver. Den enkleste måten å finne brukernavnet ditt i Minecraft er å starte opp Minecraft. Da står brukernavnet helt nede til høyre ved <strong>Play</strong>-knappen.</p> <p>Her kan du se at mitt brukernavn er <code>makerbee</code>:</p> <figure><img src='+t(3331)+' alt=""></figure> </li> <li> <p>Noe er feil med verdenen din eller med en modd som du har laget. Som regel er det en feil i den siste modden din. Gå over til nettleseren og sjekk om det er noe feil med den siste modden. Hvis du finner en feil og retter den må du:</p> <ul> <li>Trykk på <strong>mod</strong>-knappen for å oppdatere modden på serveren.</li> <li>Velg <strong>disconnect</strong> i Minecraft.</li> <li>Koble deg til serveren på nytt.</li> </ul> <p>Hvis det ikke fungerer så er det best å spørre læreren din om hjelp. Noen ganger må du velge en ny verden og legge den inn på serveren.</p> </li> </ol> </section> </section> '},3323:function(e,i,t){e.exports=t.p+"_/oppgaver/src/learntomod/1_kom_i_gang/1_learntomod.2f6391.png"},3324:function(e,i,t){e.exports=t.p+"_/oppgaver/src/learntomod/1_kom_i_gang/2_login.ac4223.png"},3325:function(e,i,t){e.exports=t.p+"_/oppgaver/src/learntomod/1_kom_i_gang/3_konto.ba57db.png"},3326:function(e,i,t){e.exports=t.p+"_/oppgaver/src/learntomod/1_kom_i_gang/image4.a1aed0.jpeg"},3327:function(e,i,t){e.exports=t.p+"_/oppgaver/src/learntomod/1_kom_i_gang/image5.7b02d5.jpeg"},3328:function(e,i,t){e.exports=t.p+"_/oppgaver/src/learntomod/1_kom_i_gang/image6.8ea869.jpeg"},3329:function(e,i,t){e.exports=t.p+"_/oppgaver/src/learntomod/1_kom_i_gang/image7.ca4dda.jpeg"},3330:function(e,i,t){e.exports=t.p+"_/oppgaver/src/learntomod/1_kom_i_gang/image8.a3f7a3.jpeg"},3331:function(e,i){e.exports="data:image/jpeg;base64,"}});